var Parent = React.createClass({
    render : function () {
        return (
            <div className="parent">
                <p>Parent</p>
                <div className="child-list">
                    <Child wait_one={1000} />
                    <Child wait_two={3000} />
                    <Child wait_three={5000} />
                </div>
            </div>
        )
    }
});

var Child = React.createClass({
	getInitialState : function () {
		return({hidden : "hidden"});
	},
	componentWillMount : function () {
        var that = this;
		setTimeout(function() {
			that.show();
		}, that.props.wait);
	},
	show : function () {
		this.setState({hidden : ""});
	},
    render : function () {
        return (
            <div className={this.state.hidden}>
                <p>1. Treat the smallest number i.e 135, as divisor (b) and bigger number i.e 225, as dividend 
                    (a)  {this.props.wait_one}ms</p>
                    <p>1. Treat the smallest number i.e 135, as divisor (b) and bigger number i.e 225, as dividend 
                    (a)  {this.props.wait_two}ms</p>
                    <p>1. Treat the smallest number i.e 135, as divisor (b) and bigger number i.e 225, as dividend 
                    (a)  {this.props.wait_three}ms</p>
            </div>

        )
    }
});
